module.exports = "<p>\r\n  If you have a sweet tooth and are craving some Chocolate then this mod should have what you need. This allows you to craft Chocolate bars and cakes to satisfy your hunger.\r\n</p>\r\n\r\n<h4>Cocoa Trees</h4>\r\n<img src=\"https://i0.wp.com/i.imgur.com/4ZtYKK8.png\" class=\"img-fluid\">\r\n<p>\r\n  When you create new maps/explore, youll start to see Cocoa Trees. These Trees are not so rare, and not so common. When you plant a Cocoa Fruit on the ground, itll grow like a sapling(same conditions, etc), but into a new Cocoa Tree. You can also\r\n  use bonemeal on it.\r\n</p>\r\n\r\n<h4>Chocolate Bar Mould</h4>\r\n<img src=\"https://i0.wp.com/i.imgur.com/ShWtGhF.jpg\" class=\"img-fluid\">\r\n<p>Recipe: 3 Cobblestone and 2 Smoothstone. What you use to mould and create the Chocolate Bars.</p>\r\n\r\n<h4>Making Chocolate</h4>\r\n<ol>\r\n  <li>Collect cocoa fruits from cocoa trees.</li>\r\n  <li>Make Cocoa Dust (2 Cocoa Dust = 3 Cocoa Beans):</li>\r\n  <img src=\"https://i0.wp.com/i.imgur.com/E9Yj3WL.jpg\" class=\"img-fluid\"><img src=\"https://i0.wp.com/i.imgur.com/In6u3Wf.jpg\" class=\"img-fluid\">\r\n  <li>Make Chocolate Milk:</li>\r\n  <img src=\"https://i0.wp.com/i.imgur.com/S3gUgRf.jpg\" class=\"img-fluid\">\r\n  Recipe: 3 Cocoa Dusts, 1 Sugar and 1 Bucket of Milk.\r\n  <strong>The Bucket of Milk can use vanilla and any OreDictionaried as 'bucketMilk' like the\r\n    <a routerLink=\"/part/tools/better_buckets\">Better Buckets</a>\r\n    in the GrimPack</strong>\r\n\r\n  <li>Smelt Chocolate Milk into Hot Chocolate Milk:</li>\r\n  <img src=\"https://i0.wp.com/i.imgur.com/xh3chI6.jpg\" class=\"img-fluid\">\r\n</ol>\r\n\r\n<h4>Making Chocolate Bars</h4>\r\n<ol>\r\n  <li>Craft a Chocolate Bar Mould</li>\r\n  <li>Pour the bowl of hot chocolate milk into the mould and wait</li>\r\n  <img src=\"https://i0.wp.com/i.imgur.com/0mzZ5mb.png\" class=\"img-fluid\">\r\n  <li>Right-click the mould with your hands empty, and left click to get the bars</li>\r\n  <img src=\"https://i0.wp.com/i.imgur.com/WwUXeD3.png\" class=\"img-fluid\">\r\n</ol>\r\n\r\n<h4>Chocolate Block</h4>\r\n<img src=\"https://i0.wp.com/i.imgur.com/ziAm44X.jpg\" class=\"img-fluid\">\r\n<p>\r\n  Recipe: 9 Chocolate Bars. For storage. Can be returned to 9 bars.\r\n</p>\r\n\r\n<h4>Craft a Candy Wrapper</h4>\r\n<h5>Recipe Shapeless  One Lapis Lazuli and One Piece of Paper</h5>\r\n<img src=\"https://i0.wp.com/i.imgur.com/8IfTijL.jpg\" class=\"img-fluid\"><img src=\"https://i0.wp.com/i.imgur.com/Il96NMB.jpg\" class=\"img-fluid\">\r\n<strong class=\"text-warning\">Wraps not returned!</strong>\r\n\r\n<h4>Making Chocolate Cake</h4>\r\n<ol>\r\n  <li>Craft two balls of chocolate.</li>\r\n  <img src=\"https://i0.wp.com/i.imgur.com/rWOOcXh.jpg\" class=\"img-fluid\">\r\n  <li>Make the cake.</li>\r\n  <img src=\"https://i0.wp.com/i.imgur.com/y9CgQkw.jpg\" class=\"img-fluid\">\r\n  Recipe: 2 Chocolate Balls, 1 Milk(bucket or bowl), 2 Sugar, 1 Egg and 3 Wheat.\r\n  <li>Eat! Nomonnmonomnmnomnomn</li>\r\n  <img src=\"https://i0.wp.com/i.imgur.com/v4RWwvV.png\" class=\"img-fluid\">\r\n</ol>\r\n"

